dot3StatsEtherChipSet = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 7, 2, 1, 17), ObjectIdentifier()).setMaxAccess("readonly")
if mibBuilder.loadTexts: dot3StatsEtherChipSet.setStatus('deprecated')
if mibBuilder.loadTexts: dot3StatsEtherChipSet.setDescription('******** THIS OBJECT IS DEPRECATED ********\n\n                    This object contains an OBJECT IDENTIFIER\n                    which identifies the chipset used to\n                    realize the interface. Ethernet-like\n                    interfaces are typically built out of\n                    several different chips. The MIB implementor\n                    is presented with a decision of which chip\n                    to identify via this object. The implementor\n                    should identify the chip which is usually\n                    called the Medium Access Control chip.\n                    If no such chip is easily identifiable,\n                    the implementor should identify the chip\n                    which actually gathers the transmit\n                    and receive statistics and error\n                    indications. This would allow a\n                    manager station to correlate the\n                    statistics and the chip generating\n                    them, giving it the ability to take\n                    into account any known anomalies\n                    in the chip.\n\n                    This object has been deprecated.  Implementation\n                    feedback indicates that it is of limited use for\n                    debugging network problems in the field, and\n                    the administrative overhead involved in\n                    maintaining a registry of chipset OIDs is not\n                    justified.')
dot3StatsSymbolErrors = MibTableColumn((1, 3, 6, 1, 2, 1, 10, 7, 2, 1, 18), Counter32()).setMaxAccess("readonly")
if mibBuilder.loadTexts: dot3StatsSymbolErrors.setReference('[IEEE 802.3 Std.], 30.3.2.1.5,\n                    aSymbolErrorDuringCarrier.')
if mibBuilder.loadTexts: dot3StatsSymbolErrors.setStatus('current')
if mibBuilder.loadTexts: dot3StatsSymbolErrors.setDescription("For an interface operating at 100 Mb/s, the\n                    number of times there was an invalid data symbol\n                    when a valid carrier was present.\n\n                    For an interface operating in half-duplex mode\n                    at 1000 Mb/s, the number of times the receiving\n                    media is non-idle (a carrier event) for a period\n                    of time equal to or greater than slotTime, and\n                    during which there was at least one occurrence\n                    of an event that causes the PHY to indicate\n                    'Data reception error' or 'carrier extend error'\n                    on the GMII.\n\n                    For an interface operating in full-duplex mode\n                    at 1000 Mb/s, the number of times the receiving\n                    media is non-idle (a carrier event) for a period\n                    of time equal to or greater than minFrameSize,\n                    and during which there was at least one\n                    occurrence of an event that causes the PHY to\n                    indicate 'Data reception error' on the GMII.\n\n                    For an interface operating at 10 Gb/s, the\n                    number of times the receiving media is non-idle\n                    (a carrier event) for a period of time equal to\n                    or greater than minFrameSize, and during which\n                    there was at least one occurrence of an event\n                    that causes the PHY to indicate 'Receive Error'\n                    on the XGMII.\n\n                    The count represented by an instance of this\n                    object is incremented at most once per carrier\n                    event, even if multiple symbol errors occur\n                    during the carrier event.  This count does\n                    not increment if a collision is present.\n\n                    This counter does not increment when the\n                    interface is operating at 10 Mb/s.\n\n                    For interfaces operating at 10 Gb/s, this\n                    counter can roll over in less than 5 minutes if\n                    it is incrementing at its maximum rate.  Since\n                    that amount of time could be less than a\n\n                    management station's poll cycle time, in order\n                    to avoid a loss of information, a management\n                    station is advised to poll the\n                    dot3HCStatsSymbolErrors object for 10 Gb/s\n                    or faster interfaces.\n\n                    Discontinuities in the value of this counter can\n                    occur at re-initialization of the management\n                    system, and at other times as indicated by the\n                    value of ifCounterDiscontinuityTime.")
